import {
    createBrowserRouter,
    RouterProvider,
  } from "react-router-dom";

import Home from './Pages/Home';
import Transferencia from './Pages/Transferencia';
import Relatorio from './Pages/Relatorio';
import Resultado from './Pages/Resultado';



export default function Rotas(){
    const home = createBrowserRouter([
        {
            path: "/",
            element: <Home />,
        },
        {
            path: "/",
            element: <Relatorio />,
        },
        {
            path: "/",
            element: <Transferencia />,
        },
        {
            path: "/",
            element: <Resultado />,
        },
    ]);
    const transferencia = createBrowserRouter([
        {
            path: "/",
            element: <Transferencia />,
        },
    ]);
    const relatorio = createBrowserRouter([
        {
            path: "/",
            element: <Relatorio />,
        },
    ]);
    const resultado = createBrowserRouter([
        {
            path: "/",
            element: <Resultado />,
        },
    ]);
    return(
        <RouterProvider router={home,transferencia,relatorio,resultado} />
    )
}
